    return (
      <div className='container'>
        <h1>Jotto</h1>
        <Congrats success={false} />
        <GuessedWords guessedWords={[
          { guessedWord: 'train' },
          { letterMatchCount: 3 }
        ]} />
      </div>
    )
  }
}
